    "schemaVersion": "1.0.0",
    "lifecycleHooks": {
        "onMount": "init",
        "onUpdate": [
            {
                "action": "updateURL",
                "observers": [
                    "viewModel.searchState",
                    "props.searchState"
                ]
            },
            {
                "action": "updateSearchCriteria",
                "observers": [
